import React from 'react';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import {makeStyles} from '@material-ui/styles';

export default function Landing() {

    return (
        <Grid
        container
        spacing={0}
        direction="row"
        alignItems="center"
        justify-content="center"
        style={{ minHeight: '100vh' }}
        >

        <Grid item xs={6}>
            <div>
                <h1>Please enter your application number:</h1>
                <input placeholder="Enter Application No."></input>
            </div>
        </Grid>
        <Grid item xs={6}>
            <div>
                <h4>Instructions for Building Permit Online Payment</h4>
            </div>
        </Grid>   

        </Grid>
    )
}
